let state = {
    messagesPage : {


        dialogs: [
            {message: 'hi!'},
            {message: 'hello!'},
            {message: 'how ar u?'},
            {message: 'good! what bout u?'}],
        profiles: [
            {name: 'Alexey', profile_id: '1'},
            {name: 'Sasha', profile_id: '2'},
            {name: 'Anton', profile_id: '3'},
            {name: 'Valera', profile_id: '4'},
        ]
    },
    profilePage:{
        posts: [
            {post: 'My Last post!', likes_count: 22},
            {post: 'My First post!', likes_count: 10}
        ]
    }
}

export default  state;
